import React, { useState } from 'react';

import ArrangementDialog from '../../Dialog/components/ArrangementDialog/ArrangementDialog';
import Modal from '../../aux/Modal';

import './styles.scss';

export default function ArrangementBig(el) {
    const [dialog, setDialog] = useState(false);
    console.log(el)

    return (
        <>
            <div onClick={() => setDialog(true)} 
                className="card-main" id="card_main">
                <img className="arr-img" src={el.pictures.file1}
                    alt="Planta" />
                <div className="card-main__footer">
                    <img src={"https://ikebana-app-users.s3-sa-east-1.amazonaws.com"+
                            "/perfil.png"} alt="Autor" />
                    <div className="card-main__footer--info">
                        <p className="card-name">Ikebana Sanguetsu</p>
                        <p className="card-desc">Cidades dispon√≠veis</p>
                    </div>
                    <div className="card-main__footer--likes">
                        <i className="material-icons">favorite</i>
                        <span className="like-counter">1337</span>
                    </div>
                </div>
            </div>
            {
                dialog &&
                    <Modal>
                        <ArrangementDialog handler={() => setDialog(false)}/>
                    </Modal>
            }
        </>
    );
}
